import styled from 'styled-components';

export const Container= styled.div `
 position:relative ;
 left:5%;
 width:90%;
 height: 600px;
 background-color: #333;
`;
export const Cardprof = styled.div`
  width:300px;
  height: 150px;
  background-size:cover;

`;

export const CardInfo = styled.div`
 position: relative;
 left:10px;
 bottom:35px;
 background-color:#f1f1f1;
 width:280px;
 height: 350px;

 img{
     position: relative;
     bottom: 55px;
     width:150px;
     height: 150px;
     border-radius: 50%;
 }
`;
